import React from "react";

export const Card = (props) => {
  const { supply, title, desc, num_last_week, num_last_month } = props;
  return (
    <div className="row">
      <div className="me-2 box bg-danger col-lg-3 col-md-6 col-sm-12">
        <div className="p-5 box1">
          <div>{supply}</div>
          <div>{title}</div>
          <div>{desc}</div>
        </div>
        <div className="littleBox1">
          <div>{num_last_week}</div>
          <div>{num_last_month}</div>
        </div>
      </div>
    </div>
  );
};
